import React from "react";
import { BrowserRouter, Route, Link, Routes } from "react-router-dom";
// import BasicJsx from "./Component/Basic.jsx/basic";
// import Imagegallary from "./Component/Images/imagegallary";
// import DataBinding from "./Component/DataBinding/DataBynding";
// import Card from "./Component/3 Card/Card";
// import Movies from "./Component/4 Movies databynding/Movies";
// import Emp from "./Component/5 emp table/Emp";
// import Event from "./Component/6 Events/Event";
// import ComA from "./Component/7 Props/ComA";
// import Parent from "./Component/7 Props/new/parent";
// import PropsMovies from "./Component/7 Props/props movies card/PropsMovies";

import Home from "./Component copy/Home";
import UserDetails from "./Component copy/UserDetails";
import User3 from "./Component copy/User3";
import { User2 } from "./Component copy/User2";
import LoginPage from "./Component/LoginPage";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="UserDetails" element={<UserDetails />} />
          <Route path="User2" element={<User2 />} />
          <Route path="User3" element={<User3 />} />
        </Routes>
      </BrowserRouter>
      {/* <LoginPage/> */}
    </div>
  );
}

export default App;
